import React, { useState } from "react";

const HigherOrderCompoent = () => {
  return (
    <>
      <h1>HigherOrderCompoent</h1>
      <Counter />
    </>
  );
};

function Counter() {
  const [count, setCount] = useState(0);

  return (
    <div>
      <h2>Count:{count}</h2>
      <button
        onClick={() => {
          setCount(count + 1);
        }}
      >
        Update
      </button>
    </div>
  );
}
export default HigherOrderCompoent;
